};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <SVG src="/img/data-model-log.svg" mdxType="SVG" />
    {
      /*
          THIS FILE IS AUTOGENERATED!
           To make changes please edit the template located at:
           website/docs/about/data-model/log.md.erb
      */
    }
    <h2 {...{
      "id": "description"
    }}>{`Description`}</h2>
    <p>{`A `}<inlineCode parentName="p">{`log`}</inlineCode>{` event is a structured represention of a point-in-time event. It contains
an arbitrary set of fields (key/value pairs) that describe the event.`}</p>
    <h2 {...{
      "id": "examples"
    }}>{`Examples`}</h2>


    <Tabs block={true} defaultValue="default" values={[{
      label: 'Default Schema',
      value: 'default'
    }, {
      label: 'Custom Fields',
      value: 'custom'
    }, {
      label: 'Nested Fields',
      value: 'nested'
    }]} mdxType="Tabs">
      <TabItem value="default" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-js"
          }}>{`{
  "host": "my.host.com",
  "message": "<13>Feb 13 20:07:26 74794bfb6795 root[8539]: i am foobar",
  "timestamp": "2019-11-01T21:15:47+00:00"
}
`}</code></pre>
      </TabItem>
      <TabItem value="custom" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-js"
          }}>{`{
  "host": "my.host.com",
  "message": "<13>Feb 13 20:07:26 74794bfb6795 root[8539]: i am foobar",
  "timestamp": "2019-11-01T21:15:47+00:00",
  "custom_field": "custom_value" // custom keys are allowed
}
`}</code></pre>
      </TabItem>
      <TabItem value="nested" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-js"
          }}>{`{
  "host": "my.host.com",
  "message": "<13>Feb 13 20:07:26 74794bfb6795 root[8539]: i am foobar",
  "timestamp": "2019-11-01T21:15:47+00:00",
  "parent": {
    "child": "child_value"
  }
}
`}</code></pre>
      </TabItem>
    </Tabs>
    <h2 {...{
      "id": "schema"
    }}>{`Schema`}</h2>
    <Alert type="info" mdxType="Alert">
      <p>{`The following fields are the `}<em parentName="p">{`default`}</em>{` schema. All of these field names can be
changed via the
`}<a parentName="p" {...{
          "href": "/docs/reference/global-options/#log_schema"
        }}>{`global `}<inlineCode parentName="a">{`log_schema`}</inlineCode>{` options`}</a>{`.`}</p>
    </Alert>
    <Fields filters={true} mdxType="Fields">
      <Field common={false} defaultValue={null} enumValues={null} examples={["my.host.com"]} groups={[]} name={"host"} path={null} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "host"
        }}>{`host`}</h3>
        <p>{`Represents the originating host of the log. This is automatically set within
select `}<a parentName="p" {...{
            "href": "/docs/reference/sources/"
          }}>{`sources`}</a>{` if the key does not exist. Change this field
name via the `}<a parentName="p" {...{
            "href": "/docs/reference/global-options/#host_key"
          }}>{`global `}<inlineCode parentName="a">{`host_key`}</inlineCode>{` option`}</a>{`
or the source-level `}<inlineCode parentName="p">{`host_key`}</inlineCode>{` option for relevant sources.
See `}<a parentName="p" {...{
            "href": "#changing-the-default-schema"
          }}>{`Changing The Default Schema`}</a>{` for more info.`}</p>
      </Field>
      <Field common={true} defaultValue={null} enumValues={null} examples={["<13>Feb 13 20:07:26 74794bfb6795 root[8539]: i am foobar"]} groups={[]} name={"message"} path={null} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "message"
        }}>{`message`}</h3>
        <p>{`Represents the log message. Change this field name via the `}<a parentName="p" {...{
            "href": "/docs/reference/global-options/#message_key"
          }}>{`global
`}<inlineCode parentName="a">{`message_key`}</inlineCode>{` option`}</a>{` or the
source-level `}<inlineCode parentName="p">{`message_key`}</inlineCode>{` option for relevant sources.
See `}<a parentName="p" {...{
            "href": "#changing-the-default-schema"
          }}>{`Changing The Default Schema`}</a>{` for more info.`}</p>
      </Field>
      <Field common={false} defaultValue={null} enumValues={null} examples={["file", "socket", "http"]} groups={[]} name={"source_type"} path={null} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "source_type"
        }}>{`source_type`}</h3>
        <p>{`The official `}<inlineCode parentName="p">{`type`}</inlineCode>{` of `}<a parentName="p" {...{
            "href": "/docs/reference/sources/"
          }}>{`Vector's source component`}</a>{` from which the
log originates. Change this field name via the `}<a parentName="p" {...{
            "href": "/docs/reference/global-options/#source_type_key"
          }}>{`global `}<inlineCode parentName="a">{`source_type_key`}</inlineCode>{`
option`}</a>{` or the source-level
`}<inlineCode parentName="p">{`source_type_key`}</inlineCode>{` option for relevant sources.`}</p>
      </Field>
      <Field common={true} defaultValue={null} enumValues={null} examples={["2019-11-01T21:15:47+00:00"]} groups={[]} name={"timestamp"} path={null} relevantWhen={null} required={true} templateable={false} type={"timestamp"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "timestamp"
        }}>{`timestamp`}</h3>
        <p>{`A normalized `}<a parentName="p" {...{
            "href": "https://docs.rs/chrono/0.4.0/chrono/struct.DateTime.html"
          }}>{`Rust DateTime struct`}</a>{` in UTC. Change this
field name via the `}<a parentName="p" {...{
            "href": "/docs/reference/global-options/#message_key"
          }}>{`global `}<inlineCode parentName="a">{`timestamp_key`}</inlineCode>{`
option`}</a>{` or the source-level
`}<inlineCode parentName="p">{`timestamp_key`}</inlineCode>{` option for relevant sources.
See `}<a parentName="p" {...{
            "href": "#changing-the-default-schema"
          }}>{`Changing The Default Schema`}</a>{` and `}<a parentName="p" {...{
            "href": "#timestamp-coercion"
          }}>{`Timestamp Coercion`}</a>{` for more info.`}</p>
      </Field>
      <Field common={false} defaultValue={null} enumValues={null} examples={[{
        "my-key": "my-value"
      }, {
        "parent": {
          "child": "child-value"
        }
      }]} groups={[]} name={"`[custom-key]`"} path={null} relevantWhen={null} required={false} templateable={false} type={"*"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "custom-key"
        }}><inlineCode parentName="h3">{`[custom-key]`}</inlineCode></h3>
        <p>{`In addition to the defined fields, a log event can have any number of
additional fields. This includes nested fields.`}</p>
      </Field>
    </Fields>
    <h2 {...{
      "id": "components"
    }}>{`Components`}</h2>
    <Jump to="/components/?event-types[]=log" mdxType="Jump">View all log compatible components</Jump>
    <h2 {...{
      "id": "how-it-works"
    }}>{`How It Works`}</h2>
    <h3 {...{
      "id": "changing-the-default-schema"
    }}>{`Changing The Default Schema`}</h3>
    <p>{`Vector is unique in that you are not required to use a specific schema. You
can change the default schema. This makes integrating Vector into existing
pipelines much easier. The `}<a parentName="p" {...{
        "href": "#message"
      }}><inlineCode parentName="a">{`message`}</inlineCode></a>{`, `}<a parentName="p" {...{
        "href": "#host"
      }}><inlineCode parentName="a">{`host`}</inlineCode></a>{`, and `}<a parentName="p" {...{
        "href": "#timestamp"
      }}><inlineCode parentName="a">{`timestamp`}</inlineCode></a>{` field names can
all be changed via the
`}<a parentName="p" {...{
        "href": "/docs/reference/global-options/#log_schema"
      }}>{`global `}<inlineCode parentName="a">{`log_schema`}</inlineCode>{` options`}</a>{`.`}</p>
    <h4 {...{
      "id": "field-name-collisions"
    }}>{`Field name collisions`}</h4>
    <p>{`When you send structured data to Vector your field names always take precedence.
For example, if you send a JSON object with a `}<a parentName="p" {...{
        "href": "#timestamp"
      }}><inlineCode parentName="a">{`timestamp`}</inlineCode></a>{` key, Vector will
`}<em parentName="p">{`not`}</em>{` override the value of that field. Vector will only set that field if it
is not present.`}</p>
    <h3 {...{
      "id": "time-zones"
    }}>{`Time Zones`}</h3>
    <p>{`If Vector receives a timestamp that does not contain timezone information
Vector assumes the timestamp is in local time, and will convert the timestamp
to UTC from the local time.`}</p>
    <h3 {...{
      "id": "dot-notation"
    }}>{`Dot Notation`}</h3>
    <p>{`Some components, such as `}<a parentName="p" {...{
        "href": "/docs/reference/transforms/rename_fields/"
      }}><inlineCode parentName="a">{`rename_fields`}</inlineCode>{` transform`}</a>{`,
accept name of a field as an option. In order to specify a nested field to them, use the
dot notation which can be described by an example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`parent_field.child_field
`}</code></pre>
    <p>{`The dot notation also supports accessing array fields using by placing the index between
`}<inlineCode parentName="p">{`[`}</inlineCode>{` and `}<inlineCode parentName="p">{`]`}</inlineCode>{` after the array field name, for example`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`array[0]
`}</code></pre>
    <p>{`The indexes start from 0, missing values are auto-filled by `}<a parentName="p" {...{
        "href": "#null-values"
      }}>{`null values`}</a>{`.`}</p>
    <Alert type="warning" mdxType="Alert">
      <p>{`It is important that the host system contain time zone data files to properly
determine the local time zone. This is typically installed through the `}<inlineCode parentName="p">{`tzdata`}</inlineCode>{`
package. See `}<a parentName="p" {...{
          "href": "https://github.com/timberio/vector/issues/551"
        }}>{`issue 551`}</a>{` for more info.`}</p>
    </Alert>
    <h3 {...{
      "id": "timestamp-coercion"
    }}>{`Timestamp Coercion`}</h3>
    <p>{`There are cases where Vector interacts with formats that do not have a formal
timestamp defintion, such as JSON. In these cases, Vector will ingest the
timestamp in it's primitive form (string or integer). You can then coerce the
field into a `}<a parentName="p" {...{
        "href": "#timestamp"
      }}><inlineCode parentName="a">{`timestamp`}</inlineCode></a>{` using the
`}<a parentName="p" {...{
        "href": "/docs/reference/transforms/coercer/"
      }}><inlineCode parentName="a">{`coercer`}</inlineCode>{` transform`}</a>{`. If you are parsing this data
out of a string, all Vector parser transforms include a `}<inlineCode parentName="p">{`types`}</inlineCode>{` option,
allowing you to extract and coerce in one step.`}</p>
    <h3 {...{
      "id": "types"
    }}>{`Types`}</h3>
    <h4 {...{
      "id": "strings"
    }}>{`Strings`}</h4>
    <p>{`Strings are UTF-8 compatible and are only bounded by the available system
memory.`}</p>
    <h4 {...{
      "id": "ints"
    }}>{`Ints`}</h4>
    <p>{`Integers are signed integers up to 64 bits.`}</p>
    <h4 {...{
      "id": "floats"
    }}>{`Floats`}</h4>
    <p>{`Floats are 64-bit `}<a parentName="p" {...{
        "href": "https://en.wikipedia.org/wiki/IEEE_754"
      }}>{`IEEE 754`}</a>{` floats.`}</p>
    <h4 {...{
      "id": "booleans"
    }}>{`Booleans`}</h4>
    <p>{`Booleans represent binary true/false values.`}</p>
    <h4 {...{
      "id": "timestamps"
    }}>{`Timestamps`}</h4>
    <p>{`Timestamps are represented as `}<a parentName="p" {...{
        "href": "https://docs.rs/chrono/0.4.0/chrono/struct.DateTime.html"
      }}><inlineCode parentName="a">{`DateTime`}</inlineCode>{` Rust structs`}</a>{`
stored as UTC.`}</p>
    <h4 {...{
      "id": "null-values"
    }}>{`Null Values`}</h4>
    <p>{`For compatibility with JSON log events, Vector also supports `}<inlineCode parentName="p">{`null`}</inlineCode>{` values.`}</p>
    <h4 {...{
      "id": "maps"
    }}>{`Maps`}</h4>
    <p>{`Maps are associative arrays mapping string fields to values of any type.`}</p>
    <h4 {...{
      "id": "arrays"
    }}>{`Arrays`}</h4>
    <p>{`Array fields are sequences of values of any type.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
